import React from "react";
function Header({ isDarkMode, onDarkModeClick }) {
  return (
    <header>
      <div>
      <img src="images/logo1.jpg" className="img"/>

      </div>
      <button onClick={onDarkModeClick}>
        {isDarkMode ? "Dark" : "Light"} Mode
      </button>
    </header>
  );
}

export default Header;
